    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>
    <style type="text/css">.remark__tile-view * {
box-sizing: border-box;
}
.remark__tile-view {
background: lightgray;
position: relative;
width: 100%;
height: 100%;
padding: 3em;
font-size: 18px;
box-sizing: border-box;
overflow: scroll;
}
.remark__tile-view__header {
text-align: center;
}
.remark__tile-view__tiles {
display: grid;


justify-items: center;
}
.remark__tile-view__tile {
position: relative;
margin: 0.5em;
padding: 0.5em;
}
.remark__tile-view__slide-container {
margin: 0 auto;
}
.remark__tile-view__tile--current {
background: #ffd863;
border: 5px solid #ffd863;
margin: calc(0.5em - 5px);
border-radius: 0;
}
.remark__tile-view__tile--seen {
opacity: 0.5;
}
.remark__tile-view__tile:hover {

background: #44bc96;
opacity: 1;
}
</style>
    <script>/*
 *  Tile View for remark.js Slides
 *
 *  Garrick Aden-Buie
 *
 *  Inspired and converted to Vanilla JS from
 *  https://github.com/StephenHesperus/remark-hook/
 *
 *  Include after remarkjs slides are initialized.
 *
 */

/* global slideshow */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const launchKey = 79 // keycode for O, used to enable tile view

    // Slides container
    const remarkSlideShow = document.querySelector('div.remark-slides-area')

    let tileView = document.querySelector('div.remark__tile-view')
    if (!tileView) {
      tileView = document.createElement('div')
      tileView.className = 'remark__tile-view'
    }

    const toggleElement = el => {
      el.style.display = el.style.display === 'none' ? '' : 'none'
    }

    function slideshowResize () {
      window.dispatchEvent(new Event('resize'))
    }

    const toggleTileView = function () {
      toggleElement(tileView)
      toggleElement(remarkSlideShow)

      if (tileView.style.display === 'none') {
        // tileView is now hidden, go to current slide
        slideshow.gotoSlide(tileVars.currentSlideIdx + 1)

        slideshow.resume()
        slideshowResize()
      } else {
        // store current slide index prior to launching tile-view
        tileVars.currentSlideIdx = slideshow.getCurrentSlideIndex()

        // set class on seen and current slide and scroll into view
        const tiles = tileView.querySelectorAll('.remark__tile-view__tile');
        [...tiles].forEach((tile, idx) => {
          tile.classList.toggle(
            'remark__tile-view__tile--seen',
            idx < tileVars.currentSlideIdx
          )
          tile.classList.toggle(
            'remark__tile-view__tile--current',
            idx === tileVars.currentSlideIdx
          )
        })
        tiles[tileVars.currentSlideIdx].scrollIntoView({
          behavior: 'smooth',
          block: 'center'
        })

        slideshow.pause()
      }
    }

    const createTileView = ({ minSize = 250, title = document.title } = {}) => {
      // Tile view header
      const h1 = document.createElement('h1')
      h1.className = 'remark__tile-view__header'
      h1.innerHTML = title

      tileView.appendChild(h1)
      const tiles = document.createElement('div')
      tiles.className = 'remark__tile-view__tiles'
      tileView.appendChild(tiles)

      // Clone slideshow
      const slidesArea = remarkSlideShow.cloneNode(true)

      // Calculate slide scale and tile container size
      const slideScaler = slidesArea.querySelector('.remark-slide-scaler')
      const slideWidth = parseFloat(slideScaler.style.width.replace('px', ''))
      const slideHeight = parseFloat(
        slideScaler.style.height.replace('px', '')
      )
      const scale = minSize / Math.min(slideWidth, slideHeight)
      let tileWidth = Math.round(slideWidth * scale)
      let tileHeight = Math.round(slideHeight * scale)

      // convert tileWidth/Height to em relative to base 18px (set in CSS)
      tileWidth = tileWidth / 18
      tileHeight = tileHeight / 18

      tiles.style.gridTemplateColumns = `repeat(auto-fill, minmax(${tileWidth}em, 1fr))`

      const slides = slidesArea.querySelectorAll('.remark-slide-container')

      slides.forEach((slide, slideIndex) => {
        let tile = document.createElement('template')
        tile.innerHTML = `<div class="remark__tile-view__tile">
            <div class="remark__tile-view__slide-container">
            </div></div>`
        tile = tile.content.firstChild

        const tileContainer = tile.querySelector(
          '.remark__tile-view__slide-container'
        )
        tileContainer.style.width = `${tileWidth}em`
        tileContainer.style.height = `${tileHeight}em`

        const thisSlideScaler = slide.querySelector('.remark-slide-scaler')
        thisSlideScaler.style.top = '0px'
        thisSlideScaler.style.left = '0px'
        thisSlideScaler.style.transform = `scale(${scale})`
        thisSlideScaler.parentElement.classList.add('remark-visible')

        slide.addEventListener('click', () => {
          tileVars.currentSlideIdx = slideIndex
          toggleTileView()
        })

        tileContainer.appendChild(slide)
        tiles.appendChild(tile)
      })

      document.body.appendChild(tileView)
    }

    const tileVars = {}

    document.addEventListener('keydown', ev => {
      if (ev.keyCode === launchKey) {
        toggleTileView()
      }
    })

    const addTileViewHelpText = () => {
      const helpTable = document.querySelector(
        '.remark-help-content table.light-keys'
      )
      if (!helpTable) {
        console.error(
          'Could not find remark help table, has remark been initialized?'
        )
        return
      }
      const newRow = document.createElement('tr')
      newRow.innerHTML += '<td><span class="key">o</span></td>'
      newRow.innerHTML += '<td>Tile View: Overview of Slides</td>'
      helpTable.append(newRow)
    }

    createTileView({ minSize: 200 })
    toggleElement(tileView)
    addTileViewHelpText()
  })
})()
</script>

# Quantile Residuals

.pull-left[
`\(r_i = \phi^{-1}\big(F(Y_i,\Theta)\big)\)`
&lt;br&gt;&lt;br&gt;

- `\(F(Y,\Theta)\)`: cdf of `\(f(y,\Theta)\)` 

- `\(\phi^{-1}\)`: cdf inverse of the standard normal distribution
&lt;br&gt;&lt;br&gt;

* **PIT Residuals**: Adds random noise to quantile residuals from discrete distributions using the probabilty integral transform

]

.pull-right[
.img90[
![](data:image/png;base64,#static/dgamma2dnorm.png)
]]
&lt;br&gt;
Dunn &amp; Smyth, 1996
---
# Pearson residuals - Issues
.large[**Pearson assumes independent standard normal**]

.pull-left-narrow[
.large[**Wrong**]&lt;br&gt; **Pearson residual**&lt;br&gt;
`\(r = (y - \mu)/sd(y)\)` &lt;br&gt;
.img70[
![](data:image/png;base64,#static/pearson.png)]
]


.three-column[
**Gamma variance depends on mean**:&lt;br&gt;
`\(y \sim Gamma(\alpha = 1, \beta = 2)\)`&lt;br&gt;
`\(var(y) = \mu\beta\)` &lt;br&gt;
&lt;center&gt;
.img70[
![](data:image/png;base64,#static/dgamma.png)]
&lt;/center&gt;
]

.pull-right-narrow[
.large[**Right**]&lt;br&gt; **Quantile residual**&lt;br&gt;
`\(r = qnorm(pgamma(y, 1, 2))\)`&lt;br&gt;
.img80[
![](data:image/png;base64,#static/qqnorm_quantile.png)]
]


![](data:image/png;base64,#static/caution-small.png) Pearson residuals will invalidate correct models more often than expected when assumptions invalid

# Pearson residuals - Issues
.large[**Pearson assumes identical and independently distributed data (iid)**]

&lt;center&gt;
.img50[
![](data:image/png;base64,#static/MN-resid.png)]
&lt;/center&gt;

![](data:image/png;base64,#static/caution-small.png) Pearson residuals will invalidate correct models more often than expected when assumptions invalid

# Validating GLMMs
&lt;br&gt;

`\begin{align}
RE &amp;\sim Normal(0, \sigma_{re}) \\
\mu &amp;= FE + RE \\
y &amp;\sim f(g(\mu)^{-1}, \sigma_{obs})
\end{align}`

&lt;br&gt;

.pull-left[
**Pearson residuals invalid**&lt;br&gt;
.p[
- Distribution is not approximately standard normal
- Observations are correlated
]]

.pull-right[
**Quantile residual issues**&lt;br&gt;
.p[
- Often no closed form expression to the joint cdf
- Still need to account for correlation in residuals
]]

# No closed form solution to the joint cdf
.large[ **Solutions: Approximations to the quantile resdiual**]
&lt;br&gt;
.p[ 
.pull-left[
**TMB R package**
- Analytical Calculations
- Laplace approximations to the cdf
- Bayesian simulations
- Methods: Full gaussian, one-step gaussian, one-step generic, cdf, MCMC via tmbstan
&lt;br&gt;&lt;br&gt;
Kristensen et al., 2016 &lt;br&gt;
Thygesen, U. et al., 2017 &lt;br&gt;
Monnahan &amp; Kristensen, 2018
]

.pull-right[
**DHARMa R package**
- Simulation-based approach
- Methods: Empirical cdf
&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;
Hartig, F., 2022
]
]

# Account for correlation in residuals

.large[**Solutions**:&lt;br&gt;
**1. Apply decorrelation transformation**&lt;br&gt;
**2. Rely on the Principle of Conditioning**]
.p[ 
.pull-left[
**TMB**
- Full gaussian: Cholesky decorrelation transformation
- One-step methods: Prequential conditioning
- Bayesian simulations: Random Effect conditioning
&lt;br&gt;&lt;br&gt;
Kristensen et al., 2016 &lt;br&gt;
Thygesen, U. et al., 2017 &lt;br&gt;
Monnahan &amp; Kristensen, 2018

Hartig, F., 2022

# TMB Methods
&lt;br&gt;&lt;br&gt;


|Method          |Definition                                                                           |
|:---------------|:------------------------------------------------------------------------------------|
|FullGaussian    |Best approach when data and random effects are both normally distributed             |
|oneStepGaussian |Most efficient one-step method when data and random effects are approximately normal |
|cdf             |One-step method that does not require normality but does require a closed form cdf   |
|oneStepGeneric  |One-step method useful when no closed form cdf but slow                              |
* The cdf and oneStepGeneric methods are the only methods available for discrete data: randomized quantile residuals
* oneStepGeneric is dependent on Laplace approximations of likelihoods, so probably important to use TMB::checkConsistency.
* OSA residuals are challenging for some distributions (eg. multinomial, delta-lognormal, tweedie). 

---
# Full Gaussian Method&lt;br&gt;

Analytical calculation that assumes joint distribution of data and random effects is Gaussian. Applies rotation to transform to univariate space. 

.pull-left-wide[
**Correlated MNV**

&lt;img src=&quot;data:image/png;base64,#static/demo_pairs1.png&quot; width=&quot;75%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

]
.pull-right-narrow[
&lt;br&gt;&lt;br&gt;
`\begin{align}
y &amp;\sim MVN(0, \Sigma)  \\
\end{align}`
]
---
# Full Gaussian Method&lt;br&gt;

Analytical calculation that assumes joint distribution of data and random effects is Gaussian. Applies rotation to transform to univariate space. 

.pull-left-wide[
**Scale to unit variance**

&lt;img src=&quot;data:image/png;base64,#static/demo_pairs2.png&quot; width=&quot;75%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]
.pull-right-narrow[
&lt;br&gt;&lt;br&gt;
`\begin{align}
y &amp;\sim MVN(0, \Sigma) \\
r &amp;= y / sqrt(diag(\Sigma))
\end{align}`
]
---
# Full Gaussian Method&lt;br&gt;

Analytical calculation that assumes joint distribution of data and random effects is Gaussian. Applies rotation to transform to univariate space. 
.pull-left-wide[
**Cholesky Transformation**

&lt;img src=&quot;data:image/png;base64,#static/demo_pairs3.png&quot; width=&quot;75%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]
.pull-right-narrow[
&lt;br&gt;&lt;br&gt;
`\begin{align}
y &amp;\sim MVN(0, \Sigma) \\
L &amp;= cholesky(\Sigma)^{T} \\
r &amp;= L^{-1}y
\end{align}`
]

# TMB One-Step Methods
&lt;br&gt;
Steps through the data calculating quantile residuals for observation `\(i\)` given all previous observations:


`\(r_{i} = \phi^{-1}(F(Y_{i}|Y_{1},\ldots, Y_{i-1},\Theta))\)`&lt;br&gt;

`\(\phi^{-1}\)`: inverse cdf of the standard normal&lt;br&gt;

`\(F(Y,\Theta)\)`: cdf of `\(f(Y,\Theta)\)`

* These residuals are independent standard normal when the model is appropriate for the data

* For non-random effects models these are equivalent to more familiar quantile residuals used with GLMs because
`\(F(Y_{i}|Y_{1},\ldots, Y_{i-1},\Theta) = F(Y_{i}|\Theta)\)`


|Method          |Definition                                                                           |
|:---------------|:------------------------------------------------------------------------------------|
|oneStepGaussian |Most efficient one-step method when data and random effects are approximately normal |
|cdf             |One-step method that does not require normality but does require a closed form cdf   |
|oneStepGeneric  |One-step method useful when no closed form cdf but slow                              |
---
# TMB One-Step Methods
&lt;br&gt;

.pull-left[
C++ code needs to be modified:

```cpp
DATA_VECTOR(y);
DATA_VECTOR_INDICATOR(keep, y);
...
for(int i=0; i &lt; N.size(); i++){
   nll -= keep[i] * dpois(y[i], exp(eta[i]), true);
   /* For cdf OSA residuals only: */
   Type cdf = squeeze( ppois(y[i], exp(eta[i])) );
   nll -= keep.cdf_lower[i] * log( cdf );       // NaN protected
   nll -= keep.cdf_upper[i] * log( 1.0 - cdf ); // NaN protected
}

```
]

.pull-right[
Call from R:

```r
#TMB model
obj &lt;- MakeADFun(data, parameters, 
                 random = &quot;u&quot;)
opt &lt;- nlminb(obj$par, obj$fn, obj$gr)

#TMB residual calculation for continuous data
oneStepPredict(obj, observation.name = &quot;y&quot;,
               data.term.indicator = &quot;keep&quot;
               method = &quot;oneStepGaussian&quot;)

#TMB residual calculation for discrete data
oneStepPredict(obj, observation.name = &quot;y&quot;,
               data.term.indicator = &quot;keep&quot;
               method = &quot;cdf&quot;, discrete = TRUE)
```
]

# TMB MCMC Method&lt;br&gt;
Bayesian simulation approach
.pull-left[
**Simplified algorithm**
.p[
1. Map fixed parameters to their MLEs
2. Create a new object
3. Draw a single posterior from an MCMC chain
4. Use the posterior random vector to recalculate the expected value and plug into cdf calculations
5. Relies on conditional independence rather than rotation
]
]

.pull-right[
&lt;br&gt;

```r
#TMB model
obj &lt;- MakeADFun(data, parameters, 
                 random = &quot;u&quot;)
opt &lt;- nlminb(obj$par, obj$fn, obj$gr)

#Fix estimated values to their MLEs
map &lt;- c(parameters = factor(NA)*length(opt$par),
         u = factor(NA)*length(u))
#Draw one posterior from a tmbstan run
obj2 &lt;- MakeADFun(..., map = map)
sample &lt;- extract( tmbstan(obj2, iter = warmup+1) )$u

#residuals using posterior u
Fy &lt;- pnorm(y, u, sigma)
r &lt;- qnorm(Fy)
```
]

# ecdf method with DHARMa

.pull-left[
&lt;br&gt;&lt;br&gt;

|Method             |Definition                                                         |
|:------------------|:------------------------------------------------------------------|
|Conditional ecdf   |Simulate new observations conditional on the fitted random effects |
|Unconditional ecdf |Simulate new observations given new simulated random effects       |
]
.pull-right[
&lt;img src=&quot;data:image/png;base64,#static/dharma-ecdf.png&quot; width=&quot;100%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
.small[source: Florian Hartig, DHARMa package]
]

---
# ecdf method with DHARMa&lt;br&gt;
.large[**Validate the data and random effect model simultaneously**]
&lt;br&gt;

.pull-left-narrow[
**DHARMa**
- **Unconditional**
]
.pull-right-wide[
&lt;br&gt;&lt;br&gt;
Empircal cdf approximation using simulated random effects and rotated data (optional)

```r
#Simulate new random effects and data use MLEs
u.sim &lt;- rnorm(mu, tau)
y.sim &lt;- rnorm(u.sim, sigma)

#cholesky decomposition based on estimated Sigma
L &lt;- t(chol(Sigma))

#rotate simulated data and observations
y.sim &lt;- apply(y.sim, 2, function(x) solve(L,x))
y &lt;- solve(L, y)

#empirical cdf on rotated data and simulation
r &lt;- ecdf(y.sim)(y)
```

]
---
# ecdf method with DHARMa&lt;br&gt;
.large[**Validate the data and random effect model simultaneously**]
&lt;br&gt;

.pull-left-narrow[
**DHARMa**
- **Unconditional**
]

.pull-right-wide[
&lt;br&gt;&lt;br&gt;
Empircal cdf approximation using simulated random effects and rotated data (optional)

```r
#TMB model
obj &lt;- MakeADFun(data, parameters, 
                 random = &quot;u&quot;)
opt &lt;- nlminb(obj$par, obj$fn, obj$gr)

obj$env$data$simRE &lt;- 1
y.sim &lt;- obj$simulate()$y

#DHARMa residual function:
createDHARMa(y.sim, y, rotation = &quot;estimated&quot;)
```

]
---
# ecdf method with DHARMa&lt;br&gt;
.large[**Validate the data model conditional on random effect MLEs**]
&lt;br&gt;

.pull-left-narrow[
**DHARMa**
- Unconditional
- **Conditional**
]
.pull-right-wide[
&lt;br&gt;&lt;br&gt;
Empircal cdf approximation using estimated random effects

```r
#Simulate data using MLEs
y.sim &lt;- rnorm(u, sigma)

#TMB model
obj &lt;- MakeADFun(data, parameters, 
                 random = &quot;u&quot;)
opt &lt;- nlminb(obj$par, obj$fn, obj$gr)

obj$env$data$simRE &lt;- 0
y.sim &lt;- obj$simulate()$y

#empirical cdf on conditionally iid data
r &lt;- ecdf(y.sim)(y)
```
]

# Guidelines in Progress
&lt;br&gt;

- Models with correlated random effect structure need to account for correlation in residuals

  - TMB&#39;s Full Gaussian method is preferred if data and RE are normal
  - DHARMa rotation needs to be implemented. This method only works when the observations are approximately normal.
  - TMB&#39;s one-step methods account for correlation through conditioning 
  - DHARMa&#39;s conditional methods account for correlation through conditioning but may underperform one-step methods
  - MCMC approach accounts for correlation but may lack power to detect mis-specification

- TMB limitations:

  - One-step methods can be difficult to use when data are a mixture of continuous and discrete observations
  
- DHARMa limitations:

  - Estimating the data covariance matrix is more prone to error when data are not normal
